import React from 'react';
import Sidebar from './components/Sidebar';
import Header from './components/Header';
import CollaboratorsTable from './components/ColaboradoresList';

const App: React.FC = () => {
  return (
    <div className="flex h-screen">
      <Sidebar />
      <div className="flex flex-col flex-1">
        <Header />
        <div className="p-6 flex-1 overflow-auto bg-gray-50">
          <div className="flex justify-between items-center mb-6">
            <h1 className="text-2xl font-bold text-gray-900">Colaboradores</h1>
            <button className="bg-green-500 hover:bg-green-600 text-white font-semibold py-2 px-4 rounded-lg">
              Novo Colaborador
            </button>
          </div>
          <CollaboratorsTable />
        </div>
      </div>
    </div>
  );
};

export default App;
